import { BrowserRouter as Router, Route } from 'react-router-dom'
import LoginCon from './components/LoginCon'
import Main from './components/Main'
import MainPage from './components/MainPage'

function App() {

  const Login = async(respones) => {

    console.log(respones)
  }

  const googleBtn = <GoogleLogin
  clientId="405204557273-prd5vmng5vcshg3ul604gl97reom0i7r.apps.googleusercontent.com"
  onSuccess={Login}
  onFailure={Login}/>

  const getExercise = async () => {
    const response = await fetch('http://127.0.0.1:5000/api/exercises/');
    const exercise = await response.json()
    return exercise
  }

  const getQuote = async () => {
    const response = await fetch('http://127.0.0.1:5000/api/quote/');
    const quote = await response.json()
    return quote

  }

  var currentPage = "home"

  return (
    <Router>
    <div className={{currentPage}}>
      <LoginCon buttonCom={googleBtn}/>
     <Main /> 

        <Route path='/profile/' component={MainPage} />


    </div>
    </Router>


  );
}

export default App;
